(14, 1, 11, 'Eden Hazard', 'ganjar-pranowo-makan-mi-di-warkop-sebungkus-kurang-dua-kebanyakan', 'Ganjar Pranowo Makan Mi di Warkop, Sebungkus Kurang Dua Kebanyakan', '<p>JAKARTA - Gubernur Jawa Tengah Ganjar Pranowo mengunggah video Instagram Reels yang menarik perhatian warganet pada Jumat 10 Desember 2021. Video Reels sederhana ini berisikan pengalaman Ganjar makan mi instan di sebuah warung kopi (warkop) di malam hari.&nbsp;</p>\r\n<p>\"Kamu pasukan Ind**ie double atau pasukan Ind**ie satu kurang dua kebanyakan? Selamat makan malam,\" ucap Ganjar dalam captionnya dengan emotikon senyum. Di video tersebut, Ganjar terlihat memakai celana jins dan sweater merah, datang ke warkop tanpa menggunakan alas kaki. Dirinya lantas memesan mi instan ke pemilik warkop ini.&nbsp; Baca juga: Ganjar Pranowo Kenalkan Pesona Nepal van Java Sambil Sepedaan Tidak hanya satu porsi, Ganjar memutuskan untuk memesan dua porsi mi instan, lengkap dengan telur. \"Dua lho mbak,\" kata Ganjar memastikan pesanannya. Sambil menunggu, dirinya duduk di lantai berselonjoran. \"Menunggu kamu,\" tulis Ganjar dalam videonya. Akhirnya, mi pesanannya datang. Namun, Ganjar sendiri menilai pesanannya terlalu banyak untuk dia habiskan. \"Sehat selalu,berkah selalu pak @ganjar_pranowo ...maem mie lawuh krupuk,team karbo,\" ucap akun @ndalemlurikbydkartika.</p>', 'ganjar.png', 0, 'publish', 'berita', 'Ganjar Pranowo Makan Mi di Warkop, Sebungkus Kurang Dua Kebanyakan', NULL, NULL, '2021-12-16 12:54:33', '2021-12-16 11:54:33'),
(15, 1, 12, '', 'mantan-panglima-tni-hadi-tjahjanto-beserta-istri-terjun-langsung-bagikan-bantuan-untuk-pengungsi-semeru', 'Mantan Panglima TNI Hadi Tjahjanto Beserta Istri Terjun Langsung Bagikan Bantuan untuk Pengungsi Semeru ', '<p><span xss=removed>JAKARTA - Mantan Panglima TNI Marsekal Purn Hadi Tjahjanto dan istrinya Ny. Nanny Hadi Tjahjanto terjun langsung memberi bantuan untuk pengungsi Gunung Semeru di Desa Supiturang, Dusun Sumbersari, Kabupaten Lumajang, Jawa Timur. Dalam kegiatan itu, setidaknya 1.000 paket yang berisi, sembako beserta selimut, beras, minyak, pampers dan obat-obatan disebar di daerah tersebut.</span></p>\r\n<p><span xss=removed>Diketahui, setidaknya ada 525 warga Desa Supiturang yang mengungsi akibat bencana itu. Ratusan rumah rusak ringan hingga berat. Bahkan beberapa rumah hancur dan roboh akibat tertimpa material erupsi dan guguran awan panas.</span></p>\r\n<p><span xss=removed>Hadi Tjahjanto, dalam kegiatan itu turut serta mendampingi sang istri terjun langsung ke lapangan. Mereka membagikan paket bantuan kepada warga di pengungsian, atau yang masih bertahan di rumah rumah mereka.</span></p>\r\n<p><span xss=removed>Beberapa warga tampak berterima kasih atas bantuan tersebut. Mereka tak menyangka yang datang merupakan mantan Panglima TNI Hadi Tjahjanto.</span></p>', 'pansos.jpg', 2, 'publish', 'berita', 'Mantan Panglima TNI Hadi Tjahjanto Beserta Istri Terjun Langsung Bagikan Bantuan untuk Pengungsi Semeru', NULL, NULL, '2021-12-11 21:17:41', '2022-03-31 00:13:25'),
(16, 1, 2, '', 'liverpool-vs-aston-villa-penalti-mohamed-salah-bawa-the-red-menang-1-0', 'Liverpool vs Aston Villa, Penalti Mohamed Salah Bawa The Red Menang 1-0', '<p><span xss=removed>Liverpool melawan Aston Villa dalam lanjutan Liga Inggris 2021-2022. Tanding di kandang sendiri, Anfield, Sabtu 11 Desember 2021, malam WIB, The Reds hanya bisa menang tipis 1-0. (REUTERS/Russell Cheyne) (ddk)</span></p>\r\n<p> </p>', 'liverpool.jpeg', 3, 'publish', 'berita', 'Liverpool vs Aston Villa, Penalti Mohamed Salah Bawa The Red Menang 1-0', NULL, NULL, '2021-12-11 21:21:54', '2022-02-15 07:02:38'),
(17, 1, 2, 'Admin', 'paris-saint-germains-sergio-ramos-wishes-club-had-avoided-ucl-draw-with-real-madrid', 'Paris Saint-Germain\'s Sergio Ramos wishes club had avoided UCL draw with Real Madrid', '<p>PARIS &ndash; Sergio Ramos seakan berkhianat dari Real Madrid. Bek tengah asal Spanyol itu rela mati demi Paris Saint-Germain (PSG) saat melawan eks klubnya pada babak 16 besar Liga Champions 2021-2022.</p>\r\n<p>Ramos pernah membela Los Blancos&mdash;julukan Real Madrid-- 16 tahun sejak 2005 lalu. Namun, pada musim panas 2021, dia dilepas oleh klubnya itu dan bergabung dengan PSG.</p>\r\n<p>Bersama Madrid, pemain asal Spanyol itu telah tampil sebanyak 671 kali dan mengangkat 22 trofi. Bahkan, dia menjuarai Liga Champions empat kali yang mana tiga di antaranya diraih secara berturut-turut pada 2016 hingga 2018.</p>\r\n<p>Akan tetapi, semua kenangan manis itu sepertinya akan disingkirkannya untuk sementara pada babak 16 besar kompetisi tertinggi antar klub Eropa itu. Pasalnya, Ramos kini rela mati untuk PSG karena dia akan memberikan segalanya untuk membawa timnya melaju ke babak selanjutnya. Baca juga: Hasil Drawing 16 Besar Liga Champions 2021-2022 Setelah Diulang: PSG vs Real Madrid, Liverpool Jumpa Inter Milan &ldquo;Anda tahu kasih sayang dan cinta yang saya miliki untuk Real Madrid. Sekarang giliran saya untuk membela PSG dan saya akan melakukan segala kemungkinan untuk lolos,&rdquo; kata Ramos dilansir dari Mirror, Selasa (14/12/2021). \"Mereka (PSG) adalah tim yang bertaruh pada saya. Saya akan mati demi PSG,&rdquo; katanya,</p>', 'sergio.jpg', 5, 'draft', 'berita', 'Paris Saint-Germain\'s Sergio Ramos wishes club had avoided UCL draw with Real Madrid', NULL, NULL, '2021-12-14 04:20:11', '2022-03-31 02:22:16');
