INSERT INTO `layanan` (`id_layanan`, `id_user`, `hits`, `judul_layanan`, `slug_layanan`, `isi_layanan`, `harga`, `gambar`, `status_layanan`, `keywords`, `tanggal_post`, `tanggal`) VALUES
(3, 1, 2, 'Product Design', 'product-design', '<div data-id=\"726c098\" data-element_type=\"widget\" data-widget_type=\"ohio_heading.default\">\r\n<div>\r\n<div>\r\n<h3>When it comes to user experience, looking pretty just won&rsquo;t cut it.</h3>\r\n</div>\r\n</div>\r\n</div>\r\n<div data-id=\"5cd3ec1\" data-element_type=\"widget\" data-widget_type=\"wp-widget-text.default\">\r\n<div>\r\n<div>\r\n<p>At Dihardja Software, we are obsessed about user experience. That&rsquo;s why during design process, we will also conduct user testing to map out user journey, identify pain points, and receive feedback from the users. We strive to deliver the best experience for users, which in turn will increase sales and reduce the chance of project failure.</p>\r\n</div>\r\n</div>\r\n</div>', '12000000', 'ux-indonesia-2NDWFiD0UMM-unsplash.jpg', 'publish', 'Product Design', '2021-12-11 06:05:12', '2021-12-17 09:10:21'),
(4, 1, 4, 'Mobile Application Development', 'mobile-application-development', '<div data-id=\"748b5146\" data-element_type=\"widget\" data-widget_type=\"ohio_heading.default\">\r\n<div>\r\n<div>Beautifully made yet powerful mobile apps</div>\r\n</div>\r\n</div>\r\n<div data-id=\"e8c89cb\" data-element_type=\"widget\" data-widget_type=\"wp-widget-text.default\">\r\n<div>\r\n<div>\r\n<p>What sets us apart from the rest is our thoughtful design, outstanding build quality, and the powerful functionalities of your mobile apps, all tailored to your specific requirements. With experience in launching hundreds of top quality iOS and Android apps, we deliver the best digital products that delights users and seamlessly integrates with your business goals.</p>\r\n</div>\r\n</div>\r\n</div>', '5000000', 'william-hook-9e9PD9blAto-unsplash.jpg', 'publish', 'Mobile Application Development', '2022-03-31 09:00:49', '2022-03-31 02:00:49'),
(5, 1, 2, 'Web Development', 'web-development', '<div data-id=\"782bc3c1\" data-element_type=\"widget\" data-widget_type=\"ohio_heading.default\">\r\n<div>\r\n<div>Online presence has never been so important. Name one great company that doesn&rsquo;t have a website today, we doubt you can find any. Especially in the post-COVID era where all things move digital, you&rsquo;ll be missing out a lot if you don&rsquo;t have any online presence. Crafting a great website becomes more important as 57% of internet users say they won&rsquo;t recommend a business with a poorly designed website. But don&rsquo;t fret &ndash; whether you want to have a beautifully-designed company website or build an entirely new digital experience for your customers, Dihardja Software is here to help.</div>\r\n</div>\r\n</div>', '14400000', 'alejandra-cifre-gonzalez-kdcOJb-TUvc-unsplash.jpg', 'publish', 'Web Development', '2021-12-12 10:45:14', '2022-03-31 00:14:13'),
